import "./App.css";
import RaffleForm from "./components/RaffleForm";
import bg from "./assets/50_50-101.png";

import {
  ApolloProvider,
  ApolloClient,
  createHttpLink,
  InMemoryCache,
} from "@apollo/client";


const httpLink = createHttpLink({
  uri: "https://api.bscgraph.org/subgraphs/name/wowswap",
});

// 3
const client = new ApolloClient({
  link: httpLink,
  cache: new InMemoryCache(),
});

// 4
ReactDOM.render(
  <ApolloProvider client={client}>
    <App />
  </ApolloProvider>,
  document.getElementById("root")
);


function App() {
  return (
    <div className="App" style={{ backgroundImage: { bg } }}>
      <img src={bg} width="100%"></img>
      <header className="App-header">
        <RaffleForm></RaffleForm>
      </header>
    </div>
  );
}

export default App;
